module.exports = {
  env: {
    browser: true,
    node: true,
    es6: true,
    jest: true,
    webextensions: true,
  },
  extends: [
    'eslint:recommended',
    'plugin:node/recommended',
    'plugin:react/recommended',
    'prettier',
  ],
  parser: '@babel/eslint-parser',
  parserOptions: {
    ecmaFeatures: {
      experimentalObjectRestSpread: true,
      jsx: true,
      legacyDecorators: true,
    },
    sourceType: 'module',
  },
  overrides: [
    {
      files: ['**/*.ts', '**/*.tsx'],
      parser: '@typescript-eslint/parser',
      rules: {
        'import/no-unresolved': 'error',
        '@typescript-eslint/array-type': ['error', { default: 'array' }],
        '@typescript-eslint/ban-types': 'error',
        '@typescript-eslint/no-unused-vars': [
          'error',
          { argsIgnorePattern: '^_' },
        ],
        'no-dupe-class-members': 'off',
        'no-undef': 'off',
        'no-unused-vars': 'off',
        'no-inner-declarations': 0, // for typescript namespace
      },
    },
  ],
  plugins: [
    '@typescript-eslint',
    'import',
    'jest',
    'react',
    'prettier',
    'no-only-tests',
  ],
  rules: {
    'prettier/prettier': 'error',
    'react/prop-types': [0],
    'no-const-assign': 'error',
    'no-this-before-super': 'error',
    'no-undef': 'error',
    'no-unreachable': 'error',
    'no-unused-vars': [
      'error',
      { varsIgnorePattern: '^_', args: 'all', argsIgnorePattern: '^_' },
    ],
    'constructor-super': 'error',
    'valid-typeof': 'error',
    'no-only-tests/no-only-tests': 'error',
    'node/no-unpublished-require': [
      'error',
      {
        allowModules: ['electron'],
      },
    ],
    'node/no-unsupported-features/es-syntax': 0,
    'node/no-unsupported-features/node-builtins': 0,
    'node/shebang': [
      'error',
      {
        convertPath: {
          'src/**/*.js': ['src/(.+)$', 'dist/$1'],
          'src/**/*.ts': ['src/(.+)ts$', 'dist/$1js'],
        },
      },
    ],
    'node/no-missing-require': [
      'error',
      {
        allowModules: ['electron'],
        tryExtensions: ['.js', '.jsx', '.json', '.ts', '.tsx', '.node'],
      },
    ],
    'node/no-missing-import': [
      'error',
      {
        allowModules: ['electron'],
        tryExtensions: ['.js', '.jsx', '.json', '.ts', '.tsx', '.node'],
      },
    ],
  },
  settings: {
    'import/parsers': {
      '@typescript-eslint/parser': ['.ts', '.tsx'],
    },
    'import/resolver': {
      typescript: {
        alwaysTryTypes: true,
        package: ['./tsconfig.json', './packages/*/tsconfig.json'],
      },
    },
    react: {
      version: 'detect',
    },
  },
  root: true,
}

{
  "trailingComma": "es5",
  "semi": false,
  "singleQuote": true,
  "endOfLine": "lf"
}

module.exports = {
  extends: ['stylelint-config-standard', 'stylelint-config-prettier'],
  plugins: ['stylelint-prettier'],
  rules: {
    'prettier/prettier': true,
  },
}

const fs = require('fs')
const path = require('path')

module.exports = {
  babelrcRoots: fs
    .readdirSync(path.join(__dirname, 'packages'))
    .map((dirname) => path.join(__dirname, 'packages', dirname))
    .filter((dirpath) => {
      const stats = fs.statSync(dirpath)
      return stats.isDirectory()
    }),
  overrides: [
    {
      presets: ['@babel/preset-typescript'],
      test: /\.tsx?$/,
    },
  ],
  presets: [
    [
      '@babel/preset-env',
      {
        targets: {
          node: '14',
        },
      },
    ],
  ],
  plugins: [
    '@babel/plugin-proposal-export-namespace-from',
    '@babel/plugin-proposal-class-properties',
  ],
}

module.exports = {
  globals: {
    'ts-jest': {
      tsConfig: 'tsconfig.base.json',
    },
  },
  projects: ['<rootDir>/packages/*/jest.config.js'],
  testEnvironment: 'jsdom',
  testEnvironmentOptions: {
    url: 'http://localhost/index.html',
  },
  moduleNameMapper: {
    '^.+\\.(css|scss)$': 'identity-obj-proxy',
  },
  setupFilesAfterEnv: ['./scripts/jest/test.config.js'],
  testMatch: ['**/__test?(s)__/**/*.spec.[jt]s?(x)'],
  testPathIgnorePatterns: ['/node_modules/'],
  transform: {
    '^.+\\.jsx?$': 'babel-jest',
    '^.+\\.tsx?$': 'ts-jest',
  },
}

require('@testing-library/jest-dom/extend-expect') // matchers for view tests

window.HTMLElement.prototype.scrollTo = jest.fn()

class MutationObserver {
  constructor() {
    this.observe = jest.fn()
    this.disconnect = jest.fn()
  }
}

window.MutationObserver = MutationObserver

{
  "compilerOptions": {
    "composite": true,
    "lib": ["es5", "es6", "es2017", "es2019", "dom", "dom.iterable"],
    "declaration": true,
    "declarationMap": true,
    "strict": true,
    /* Dont fail over type things in node_modules */
    "skipLibCheck": true,

    /* Additional Checks */
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    "noImplicitReturns": true,
    "noFallthroughCasesInSwitch": true,

    /* Module Resolution Options */
    "esModuleInterop": true,
    "module": "commonjs",
    "moduleResolution": "node",
    "sourceMap": true,
    "target": "ES2021",
    "types": ["node", "jest"]
  }
}

{
